///CONVERT TO STRING
std::string STR_xok(DATA_xok.begin(),DATA_xok.end());
std::string STR_xok2(DATA_xok2.begin(),DATA_xok2.end());
std::string STR_xok3(DATA_xok3.begin(),DATA_xok3.end());
std::string STR_xokhand(DATA_xokhand.begin(),DATA_xokhand.end());
std::string STR_xokmodal(DATA_xokmodal.begin(),DATA_xokmodal.end());
std::string STR_err(DATA_err.begin(),DATA_err.end());

std::string STR_ok1(DATA_ok1.begin(),DATA_ok1.end());
std::string STR_ok2(DATA_ok2.begin(),DATA_ok2.end());
std::string STR_ok3(DATA_ok3.begin(),DATA_ok3.end());

std::string sound_file;

int main()
{
    ///RANDOM XOKS
    srand(time(NULL));

    ///i wrapped this huge chonk in an if(true) because then i could hide it in my editor
    ///code::blocks is really bad at handling long strings
    if(true)
    {
    sound_file = "";
    }

    std::string tmp = getenv("TEMP");
    std::string tmpfilename = tmp+"\\xok.wav";

    ///EXTRACT THE FILE TO TEMP
    std::string snd = base64_decode(sound_file);
    std::ofstream osnd(tmpfilename,std::ios::binary);

    if(osnd.is_open())
    {
        osnd.write(snd.c_str(),sizeof(char)*snd.size());
    }

    osnd.close();

    ///TEXTURES
    sf::Texture t_xok,t_xok2,t_xok3,t_err,t_ok1,t_ok2,t_ok3,t_xokhand,t_xokmodal;
    t_xok.loadFromMemory(STR_xok.data(),STR_xok.size());
    t_xok2.loadFromMemory(STR_xok2.data(),STR_xok2.size());
    t_xok3.loadFromMemory(STR_xok3.data(),STR_xok3.size());
    t_xokhand.loadFromMemory(STR_xokhand.data(),STR_xokhand.size());
    t_xokmodal.loadFromMemory(STR_xokmodal.data(),STR_xokmodal.size());
    t_err.loadFromMemory(STR_err.data(),STR_err.size());

    t_ok1.loadFromMemory(STR_ok1.data(),STR_ok1.size());
    t_ok2.loadFromMemory(STR_ok2.data(),STR_ok2.size());
    t_ok3.loadFromMemory(STR_ok3.data(),STR_ok3.size());

    ///SPRITES
    sf::Sprite s_xok,s_err,s_ok,s_xokhand,s_xokmodal;
    s_xok.setTexture(t_xok);
    s_xokhand.setTexture(t_xokhand);
    s_xokmodal.setTexture(t_xokmodal);
    s_err.setTexture(t_err);

    int v = rand() % 15;
    if(v < 2)
    s_xok.setTexture(t_xok2);
    if(v == 2)
    s_xok.setTexture(t_xok3);

    bool hand = false;

    ///XOK WINDOW
    sf::RenderWindow window(sf::VideoMode(160, 140), "Error", sf::Style::Titlebar);
    window.setFramerateLimit(60);

    ///RECTANGLE
    sf::RectangleShape r_ok;
    r_ok.setSize(sf::Vector2f(window.getSize().x,42));
    r_ok.setFillColor(sf::Color(240,240,240,255));
    r_ok.setOrigin(0,42);

    ///BUTTON
    int ok_state = 0;
    bool touched = false;

    PlaySound(tmpfilename.c_str(), NULL, SND_ASYNC);

    while (window.isOpen())
    {
        ///EVENTS
        sf::Event event;
        while(window.pollEvent(event))
        {
            if(event.type == sf::Event::Closed)
                window.close();

            if(event.type == sf::Event::MouseButtonReleased)
            {
                ok_state = 0;

                if(touched)
                {
                    if(event.mouseButton.x > s_ok.getPosition().x)
                    {
                        if(event.mouseButton.x < s_ok.getPosition().x+s_ok.getGlobalBounds().width)
                        {
                            if(event.mouseButton.y > s_ok.getPosition().y)
                            {
                                if(event.mouseButton.y < s_ok.getPosition().y+s_ok.getGlobalBounds().height)
                                {
                                    return 0;
                                }
                            }
                        }
                    }
                }

                touched = false;
            }

            if (event.type == sf::Event::LostFocus)
                ok_state = 2;

            if (event.type == sf::Event::GainedFocus)
                ok_state = 0;

            if (event.type == sf::Event::MouseButtonPressed)
            {
                if (event.mouseButton.button == sf::Mouse::Left)
                {
                    if(event.mouseButton.x > s_ok.getPosition().x)
                    {
                        if(event.mouseButton.x < s_ok.getPosition().x+s_ok.getGlobalBounds().width)
                        {
                            if(event.mouseButton.y > s_ok.getPosition().y)
                            {
                                if(event.mouseButton.y < s_ok.getPosition().y+s_ok.getGlobalBounds().height)
                                {
                                    ok_state = 1;
                                    touched = true;
                                }
                            }
                        }
                    }
                }
            }

            if (event.type == sf::Event::MouseMoved)
            {
                bool bounds = false;

                if(event.mouseMove.x > s_ok.getPosition().x)
                {
                    if(event.mouseMove.x < s_ok.getPosition().x+s_ok.getGlobalBounds().width)
                    {
                        if(event.mouseMove.y > s_ok.getPosition().y)
                        {
                            if(event.mouseMove.y < s_ok.getPosition().y+s_ok.getGlobalBounds().height)
                            {
                                bounds = true;
                            }
                        }
                    }
                }

                if(!bounds)
                {
                    if(touched)
                    {
                        touched = false;
                        ok_state = 0;
                    }
                }
            }
        }

        ///DRAW CALL
        window.clear(sf::Color::White);

        switch(ok_state)
        {
            case 0:
            {
                s_ok.setTexture(t_ok1);
                break;
            }

            case 1:
            {
                s_ok.setTexture(t_ok2);
                break;
            }

            case 2:
            {
                s_ok.setTexture(t_ok3);
                break;
            }
        }

        ///XOK WITH HAND (transparency wasn't working maybe i'll fix it someday)
        if(hand)
        {
            s_xokmodal.setPosition(30,30);
            s_xokhand.setPosition(16,50);
            window.draw(s_xokmodal);
            window.draw(s_xokhand);

            s_ok.setPosition(window.getSize().x-108,window.getSize().y-37);
        }
        else
        {
            s_err.setPosition(16,26);
            s_xok.setPosition(58,0);
            window.draw(s_err);
            window.draw(s_xok);

            r_ok.setPosition(0,window.getSize().y);
            window.draw(r_ok);

            s_ok.setPosition(window.getSize().x-98,window.getSize().y-32);
        }

        window.draw(s_ok);

        window.display();
    }

    return 0;
}
